import { useDispatch} from 'react-redux';
import { getOrders } from '../../actions/orders';
import React, { useEffect } from 'react';
import { useSelector } from 'react-redux';

const Order = () => {
  const dispatch = useDispatch();

  useEffect(() => {
        dispatch(getOrders());
    }, [dispatch]);

  const orders = useSelector((state) => state.orders);
    console.log(orders)
  return (
    <div>
      {
          orders.map((order) => (                            
              <div key={order._id}>
                  <h3 className="wcard__title">{order.work}</h3>
                  <h3 className="wcard__name">{order.firstName} {order.lastName}</h3>

                  <p className='dv' id = "dv">{order.contact}</p>
              </div>
          ))
      }
    </div>
  )
}

export default Order;
